var makeDom=require("../utils").makeDom,assert=require("assert");describe("helpers",function(){describe("removeSubsets",function(){var e=require("../..").removeSubsets,n=makeDom("<div><p><span></span></p><p></p></div>")[0];it("removes identical trees",function(){var t=e([n,n]);assert.equal(t.length,1)}),it("Removes subsets found first",function(){var t=e([n,n.children[0].children[0]]);assert.equal(t.length,1)}),it("Removes subsets found last",function(){var t=e([n.children[0],n]);assert.equal(t.length,1)}),it("Does not remove unique trees",function(){var t=e([n.children[0],n.children[1]]);assert.equal(t.length,2)})})});